import "./Home.css";
import React from "react";
import { Link } from "react-router-dom";
import Table from "./Table";
import MapHome from "./kakao/MapHome";
import {
    NavbarBrand,
    Navbar,
    Nav,
    Form,
    FormControl,
    Button,
    NavDropdown,
    InputGroup,
} from "react-bootstrap";

class TestHome extends React.Component {
    render() {
        return (
            <>
                <Navbar bg="dark" variant="dark">
                    <Navbar.Brand href="/Home" className="pt-3">
                        StudyMatching
                    </Navbar.Brand>
                    <Nav className="mr-auto">
                        <Nav.Link href="#home">Home</Nav.Link>
                        <Nav.Link href="/Table">게시판</Nav.Link>
                        <Nav.Link href="#pricing">지도보기</Nav.Link>
                    </Nav>
                    <Form inline>
                        <Button variant="outline-info" className="mr-2">
                            로그인
                        </Button>
                        <Button variant="outline-info">회원가입</Button>
                    </Form>
                </Navbar>
            </>
        );
    }
}

export default TestHome;
